Mongodb populating field on aggregation query<p>I have these three collections (Products, Users &amp; Comments)</p>
<p><strong>1. Product Model</strong></p>
<pre><code>var ProductSchema = new Schema({
  title:          { type: String, text: true, required: true },
  description:    { type: String, required: true },
  category:       [{ type: String, required: true }],
  type:           [{ type: String, required: true }],
  isUsed:         { type: Boolean, },
  manufacturer:   { type: String },
  price:          { type: Number },
});
</code></pre>
<p><strong>2. User Model</strong></p>
<pre><code>var UserSchema = new Schema({
  firstName:      { type: String, text: true, required: true },
  lastName:       { type: String, text: true, required: true },
  country:        [{ type: String, required: true }],
  phoneNumber:    [{ type: String, required: true }]
});
</code></pre>
<p><strong>3. Comment Model</strong></p>
<pre><code>var CommentSchema = new Schema({
  comment:        { type: String, text: true, required: true },
  commented_by:   { type: Schema.Types.ObjectId, ref: 'User', required: true },
  commented_on:   { type: Schema.Types.ObjectId, ref: 'Product', required: true }
});
</code></pre>
<p>Then, when a request is sent to get a specific <strong>product</strong>, this is the mongoose code that runs in the background.</p>
<pre><code>      var aggregate = Product.aggregate([

        { &quot;$match&quot;: { _id: ObjectId(req.params.id) } },  /** which is the product id **/
        { &quot;$limit&quot;: 1 },

        { 
          $lookup: {
              from: 'comments',
              let: { id: &quot;$_id&quot; },
              pipeline: [
                { $match: { $expr: { $eq: [ &quot;$commented_on.product&quot;, &quot;$$id&quot; ] } } },
            ],
              as: &quot;comments&quot;
            }
        },  

        { 
          $addFields: {
            comments: &quot;$comments&quot;,
            comments_no: { $size: &quot;$comments&quot; },
            hasCommented: { $in: [ObjectId(req.user._id), &quot;$comments.commented_by&quot; ] }, /** req.user._id  is the user's id **/
          }
        },
          {
            $project: {
              _id: 1,
              title: 1,
              description: 1,
              category: 1,
              type: 1,
              price: 1,
              comments: 1,
              hasCommented: 1,
              comments_no: 1,
            }
          }
      ]);

</code></pre>
<p><strong>Output</strong></p>
<pre><code>{
    &quot;_id&quot;: &quot;5f992b5338f5f035f35911c5&quot;,
    &quot;title&quot;: &quot;Some title here...&quot;
    &quot;description&quot;: Some description here ...
    &quot;price&quot;: 1000,
    &quot;category&quot;: &quot;Clothing&quot;,
    &quot;type&quot;: &quot;shoe&quot;,
    &quot;comments&quot;: [ 
        {
          &quot;comment&quot;: &quot;Nice Product&quot;,
          &quot;commented_by&quot;: &quot;5f992b5338f5f035f35911b2&quot;,
          &quot;commented_on&quot;: &quot;5f992b5338f5f035f35911c5&quot;
        },
        {
          &quot;comment&quot;: &quot;I like this product&quot;,
          &quot;commented_by&quot;: &quot;5f992b5338f5f035f35911a2&quot;,
          &quot;commented_on&quot;: &quot;5f992b5338f5f035f35911c5&quot;
        },
        {
          &quot;comment&quot;: &quot;Great, I like it!&quot;,
          &quot;commented_by&quot;: &quot;5f992b5338f5f035f35911c8&quot;,
          &quot;commented_on&quot;: &quot;5f992b5338f5f035f35911c5&quot;
        } 

    ],
    &quot;hasCommented&quot;: true,
    &quot;comments_no&quot;: 3
}
</code></pre>
<p><strong>Expected Result</strong></p>
<pre><code>{
    &quot;_id&quot;: &quot;5f992b5338f5f035f35911c5&quot;,
    &quot;title&quot;: &quot;Some title here...&quot;
    &quot;description&quot;: Some description here ...
    &quot;price&quot;: 1000,
    &quot;category&quot;: &quot;Clothing&quot;,
    &quot;type&quot;: &quot;shoe&quot;,
    &quot;comments&quot;: [ 
        {
          &quot;comment&quot;: &quot;Nice Product&quot;,
          &quot;commented_by&quot;: { 
              &quot;_id&quot;: &quot;5f992b5338f5f035f35911b2&quot;,
              &quot;firstName&quot;: &quot;Jack&quot;,
              &quot;lastName&quot;: &quot;Sparrow&quot; 
          },
          &quot;commented_on&quot;: &quot;5f992b5338f5f035f35911c5&quot;
        },
        {
          &quot;comment&quot;: &quot;I like this product&quot;,
          &quot;commented_by&quot;: { 
              &quot;_id&quot;: &quot;5f992b5338f5f035f35911a2&quot;,
              &quot;firstName&quot;: &quot;John&quot;,
              &quot;lastName&quot;: &quot;Doe&quot; 
          },
          &quot;commented_on&quot;: &quot;5f992b5338f5f035f35911c5&quot;
        },
        {
          &quot;comment&quot;: &quot;Great, I like it!&quot;,
          &quot;commented_by&quot;: { 
              &quot;_id&quot;: &quot;5f992b5338f5f035f35911c8&quot;,
              &quot;firstName&quot;: &quot;Mary&quot;,
              &quot;lastName&quot;: &quot;Jane&quot; 
          },
          &quot;commented_on&quot;: &quot;5f992b5338f5f035f35911c5&quot;
        } 

    ],
    &quot;hasCommented&quot;: true,
    &quot;comments_no&quot;: 3
}
</code></pre>
<p>When getting a specific product, I am able now to list comments of the product with it but the problem is on all listed comments on &quot;commented_by&quot; section I need to populate it (need the firstName, lastName...) field with it.</p>
<p>Any idea how can I do this?</p>

