how to find multiple data in mongoose?<p>I cannot see data matching status and name this way. When I run this, the status and name are searching separately. but I want to get the data matching both.</p>
<pre><code>return await Product.find({
  $or: [
    { status: args.status },
    { product_name: args.product_name}
   ]
}).sort({ createdAt: &quot;desc&quot; });
</code></pre>
<p>I tried filter and aggregate but I could not get the correct data.</p>
<p>status can be <code>null</code>. <code>$and</code> it doesn't work for me.</p>
<p><strong>solved</strong></p>
<pre><code>let filter = {};
if (args.status) {
  filter.status = args.status;
}
if (args.product_name) {
  filter.product_name = args.product_name;
}
const result = await Product.find({
  ...filter
}).sort({ createdAt: &quot;desc&quot; });

return result;
</code></pre>

